import React from "react";

import styles from "./Footer.module.css";

const Footer = (props) => {
  return (
    <div className={styles["body-city"]}>
      {props.dataFooter.map((dataFooter) => (
        <FooterColumn
          key={Math.random().toString()}
          name={dataFooter.name}
          city={dataFooter.city}
          price={dataFooter.price}
          rate={dataFooter.rate}
          type={dataFooter.type}
          image_url={dataFooter.image_url}
        />
      ))}
    </div>
  );
};

export default Footer;
